// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title SmartMatrixForsage
 * @notice Multi-level marketing smart contract with X3 matrix structure
 * @dev Modified version with working withdrawals and simplified single-matrix system
 * 
 * Key Features:
 * - User registration under referrers
 * - 12 progressive levels (0.025 ETH to 51.2 ETH)
 * - X3 matrix: 3 referral slots per level
 * - Automatic matrix cycling and reinvestment
 * - Balance tracking with withdrawal functionality
 * 
 * Changes from original Forsage:
 * - Removed X6 matrix (complexity reduction)
 * - Added working withdrawal system
 * - Improved balance tracking (totalEarned + availableBalance)
 * - Updated to Solidity 0.8+ (built-in overflow protection)
 */
contract SmartMatrixForsage {

    /*//////////////////////////////////////////////////////////////
                                STRUCTS
    //////////////////////////////////////////////////////////////*/

    /**
     * @dev User account information
     * @param id Unique user identifier (starts from 1 for owner)
     * @param referrer Address who referred this user
     * @param partnersCount Number of direct referrals
     * @param totalEarned Lifetime earnings in wei (never decreases)
     * @param availableBalance Withdrawable balance in wei
     * @param activeX3Levels Mapping of level => activation status
     * @param x3Matrix Mapping of level => matrix data
     */
    struct User {
        uint256 id;
        address referrer;
        uint256 partnersCount;
        uint256 totalEarned;
        uint256 availableBalance;

        mapping(uint8 => bool) activeX3Levels;
        mapping(uint8 => X3) x3Matrix;
    }

    /**
     * @dev X3 Matrix structure (3 referral slots)
     * @param currentReferrer User's upline in this level
     * @param referrals Array of up to 3 direct referrals
     * @param blocked True if matrix filled but next level not purchased
     * @param reinvestCount Number of times matrix has cycled
     */
    struct X3 {
        address currentReferrer;
        address[] referrals;
        bool blocked;
        uint256 reinvestCount;
    }

    /*//////////////////////////////////////////////////////////////
                            STATE VARIABLES
    //////////////////////////////////////////////////////////////*/

    /// @notice Total number of levels
    uint8 public constant LAST_LEVEL = 12;

    /// @notice User data by address
    mapping(address => User) public users;

    /// @notice Address lookup by user ID
    mapping(uint256 => address) public idToAddress;

    /// @notice Address lookup by user ID (duplicate for compatibility)
    mapping(uint256 => address) public userIds;

    /// @notice Next user ID to assign
    uint256 public lastUserId = 2;

    /// @notice Contract owner (immutable after deployment)
    address public immutable owner;

    /// @notice Price in wei for each level
    mapping(uint8 => uint256) public levelPrice;

    /*//////////////////////////////////////////////////////////////
                                EVENTS
    //////////////////////////////////////////////////////////////*/

    event Registration(address indexed user, address indexed referrer, uint256 indexed userId, uint256 referrerId);
    event Reinvest(address indexed user, address indexed currentReferrer, address indexed caller, uint8 matrix, uint8 level);
    event Upgrade(address indexed user, address indexed referrer, uint8 matrix, uint8 level);
    event NewUserPlace(address indexed user, address indexed referrer, uint8 matrix, uint8 level, uint8 place);
    event MissedEthReceive(address indexed receiver, address indexed from, uint8 matrix, uint8 level);
    event SentExtraEthDividends(address indexed from, address indexed receiver, uint8 matrix, uint8 level);
    event EarningsCredited(address indexed user, address indexed from, uint8 matrix, uint8 level, uint256 amount);
    event Withdrawal(address indexed user, uint256 amount);

    /*//////////////////////////////////////////////////////////////
                              CONSTRUCTOR
    //////////////////////////////////////////////////////////////*/

    /**
     * @notice Initialize contract with owner
     * @param ownerAddress Address to set as owner (gets user ID 1)
     * @dev Owner is pre-registered with all levels active
     */
    constructor(address ownerAddress) {
        require(ownerAddress != address(0), "Invalid owner address");

        // Set level prices (each level costs 2x previous)
        levelPrice[1] = 0.025 ether;
        for (uint8 i = 2; i <= LAST_LEVEL; i++) {
            levelPrice[i] = levelPrice[i-1] * 2;
        }

        owner = ownerAddress;

        // Register owner as user ID 1
        User storage user = users[ownerAddress];
        user.id = 1;
        user.referrer = address(0);
        user.partnersCount = 0;
        user.totalEarned = 0;
        user.availableBalance = 0;

        idToAddress[1] = ownerAddress;
        userIds[1] = ownerAddress;

        // Activate all levels for owner
        for (uint8 i = 1; i <= LAST_LEVEL; i++) {
            users[ownerAddress].activeX3Levels[i] = true;
        }
    }

    /*//////////////////////////////////////////////////////////////
                        REGISTRATION FUNCTIONS
    //////////////////////////////////////////////////////////////*/

    /// @notice Fallback: register sender under owner
    receive() external payable {
        registration(msg.sender, owner);
    }

    /// @notice Fallback: register with referrer from calldata
    fallback() external payable {
        if(msg.data.length == 20) {
            registration(msg.sender, bytesToAddress(msg.data));
        } else {
            registration(msg.sender, owner);
        }
    }

    /**
     * @notice Register a new user under a referrer
     * @param referrerAddress Existing user to use as referrer
     * @dev Requires exactly 0.05 ETH payment. Activates level 1 automatically.
     */
    function registrationExt(address referrerAddress) external payable {
        registration(msg.sender, referrerAddress);
    }

    /**
     * @dev Internal registration logic
     * @param userAddress Address to register
     * @param referrerAddress Referrer's address (must exist and have level 1)
     */
    function registration(address userAddress, address referrerAddress) private {
        require(msg.value == 0.05 ether, "registration cost 0.05");
        require(!isUserExists(userAddress), "user exists");
        require(isUserExists(referrerAddress), "referrer not exists");

        // Prevent contracts from registering
        uint32 size;
        assembly {
            size := extcodesize(userAddress)
        }
        require(size == 0, "cannot be a contract");

        // Create user
        User storage user = users[userAddress];
        user.id = lastUserId;
        user.referrer = referrerAddress;
        user.partnersCount = 0;
        user.totalEarned = 0;
        user.availableBalance = 0;

        idToAddress[lastUserId] = userAddress;
        userIds[lastUserId] = userAddress;
        users[userAddress].activeX3Levels[1] = true;

        lastUserId++;
        users[referrerAddress].partnersCount++;

        // Place in matrix
        address freeX3Referrer = findFreeX3Referrer(userAddress, 1);
        users[userAddress].x3Matrix[1].currentReferrer = freeX3Referrer;
        updateX3Referrer(userAddress, freeX3Referrer, 1);

        emit Registration(userAddress, referrerAddress, users[userAddress].id, users[referrerAddress].id);
    }

    /*//////////////////////////////////////////////////////////////
                          LEVEL PURCHASE
    //////////////////////////////////////////////////////////////*/

    /**
     * @notice Purchase a new level
     * @param matrix Matrix type (must be 1 for X3, X6 removed)
     * @param level Level to purchase (2-12)
     * @dev User must own previous level. Payment must match level price.
     */
    function buyNewLevel(uint8 matrix, uint8 level) external payable {
        require(isUserExists(msg.sender), "user is not exists. Register first.");
        require(matrix == 1, "invalid matrix");
        require(msg.value == levelPrice[level], "invalid price");
        require(level > 1 && level <= LAST_LEVEL, "invalid level");
        require(!users[msg.sender].activeX3Levels[level], "level already activated");

        // Unblock previous level if needed
        if (users[msg.sender].x3Matrix[level-1].blocked) {
            users[msg.sender].x3Matrix[level-1].blocked = false;
        }

        // Activate level and place in matrix
        address freeX3Referrer = findFreeX3Referrer(msg.sender, level);
        users[msg.sender].x3Matrix[level].currentReferrer = freeX3Referrer;
        users[msg.sender].activeX3Levels[level] = true;
        updateX3Referrer(msg.sender, freeX3Referrer, level);

        emit Upgrade(msg.sender, freeX3Referrer, 1, level);
    }

    /*//////////////////////////////////////////////////////////////
                          MATRIX LOGIC
    //////////////////////////////////////////////////////////////*/

    /**
     * @dev Update matrix when user joins a level
     * @param userAddress User being placed
     * @param referrerAddress User whose matrix to join
     * @param level Level number
     * 
     * Matrix Cycling Logic:
     * - Matrix holds 3 referrals
     * - When 3rd referral joins, matrix is "full"
     * - Full matrix: clear referrals, increment cycle count
     * - Referrer re-enters their own upline's matrix
     * - Creates infinite earning potential
     */
    function updateX3Referrer(address userAddress, address referrerAddress, uint8 level) private {
        users[referrerAddress].x3Matrix[level].referrals.push(userAddress);

        // Matrix not full yet - credit payment and exit
        if (users[referrerAddress].x3Matrix[level].referrals.length < 3) {
            emit NewUserPlace(userAddress, referrerAddress, 1, level, uint8(users[referrerAddress].x3Matrix[level].referrals.length));
            return sendETHDividends(referrerAddress, userAddress, 1, level);
        }

        // Matrix full (3/3) - cycle and reinvest
        emit NewUserPlace(userAddress, referrerAddress, 1, level, 3);

        delete users[referrerAddress].x3Matrix[level].referrals;

        // Block if next level not purchased
        if (!users[referrerAddress].activeX3Levels[level+1] && level != LAST_LEVEL) {
            users[referrerAddress].x3Matrix[level].blocked = true;
        }

        // Referrer re-enters upline (recursive)
        if (referrerAddress != owner) {
            address freeReferrerAddress = findFreeX3Referrer(referrerAddress, level);
            if (users[referrerAddress].x3Matrix[level].currentReferrer != freeReferrerAddress) {
                users[referrerAddress].x3Matrix[level].currentReferrer = freeReferrerAddress;
            }

            users[referrerAddress].x3Matrix[level].reinvestCount++;
            emit Reinvest(referrerAddress, freeReferrerAddress, userAddress, 1, level);
            updateX3Referrer(referrerAddress, freeReferrerAddress, level);
        } else {
            // Owner doesn't re-enter, just collects payment
            sendETHDividends(owner, userAddress, 1, level);
            users[owner].x3Matrix[level].reinvestCount++;
            emit Reinvest(owner, address(0), userAddress, 1, level);
        }
    }

    /**
     * @notice Find the first active referrer up the chain for a level
     * @param userAddress Starting user
     * @param level Level to check
     * @return address First referrer with level active
     * @dev Walks up referrer chain until finding active user
     */
    function findFreeX3Referrer(address userAddress, uint8 level) public view returns(address) {
        while (true) {
            if (users[users[userAddress].referrer].activeX3Levels[level]) {
                return users[userAddress].referrer;
            }
            userAddress = users[userAddress].referrer;
        }
    }

    /**
     * @dev Find who should receive payment (handles blocked matrices)
     * @param userAddress Initial receiver
     * @param _from User who triggered payment
     * @param level Level of payment
     * @return receiver Address to receive payment
     * @return isExtraDividends True if payment passed up due to blocking
     */
    function findEthReceiver(address userAddress, address _from, uint8 matrix, uint8 level) private returns(address, bool) {
        address receiver = userAddress;
        bool isExtraDividends;

        // Walk up chain until finding non-blocked receiver
        while (true) {
            if (users[receiver].x3Matrix[level].blocked) {
                emit MissedEthReceive(receiver, _from, 1, level);
                isExtraDividends = true;
                receiver = users[receiver].x3Matrix[level].currentReferrer;
            } else {
                return (receiver, isExtraDividends);
            }
        }
    }

    /**
     * @dev Credit payment to user's balance
     * @param userAddress User to pay
     * @param _from User who triggered payment
     * @param level Level of payment
     */
    function sendETHDividends(address userAddress, address _from, uint8 matrix, uint8 level) private {
        (address receiver, bool isExtraDividends) = findEthReceiver(userAddress, _from, matrix, level);

        uint256 amount = levelPrice[level];

        // Credit to balance instead of direct transfer
        users[receiver].totalEarned += amount;
        users[receiver].availableBalance += amount;

        emit EarningsCredited(receiver, _from, matrix, level, amount);

        if (isExtraDividends) {
            emit SentExtraEthDividends(_from, receiver, matrix, level);
        }
    }

    /*//////////////////////////////////////////////////////////////
                          WITHDRAWAL FUNCTIONS
    //////////////////////////////////////////////////////////////*/

    /**
     * @notice Withdraw entire available balance
     * @dev Transfers all availableBalance to caller
     */
    function withdraw() external {
        require(isUserExists(msg.sender), "User not registered");
        uint256 amount = users[msg.sender].availableBalance;
        require(amount > 0, "No balance to withdraw");

        users[msg.sender].availableBalance = 0;

        emit Withdrawal(msg.sender, amount);

        (bool success, ) = payable(msg.sender).call{value: amount}("");
        require(success, "Withdrawal failed");
    }

    /**
     * @notice Withdraw specific amount
     * @param _amount Amount in wei to withdraw
     */
    function withdrawAmount(uint256 _amount) external {
        require(isUserExists(msg.sender), "User not registered");
        require(_amount > 0, "Amount must be positive");
        require(users[msg.sender].availableBalance >= _amount, "Insufficient balance");

        users[msg.sender].availableBalance -= _amount;

        emit Withdrawal(msg.sender, _amount);

        (bool success, ) = payable(msg.sender).call{value: _amount}("");
        require(success, "Withdrawal failed");
    }

    /*//////////////////////////////////////////////////////////////
                          VIEW FUNCTIONS
    //////////////////////////////////////////////////////////////*/

    /**
     * @notice Check if level is active for user
     * @param userAddress User to check
     * @param level Level to check (1-12)
     * @return bool True if level is active
     */
    function usersActiveX3Levels(address userAddress, uint8 level) public view returns(bool) {
        return users[userAddress].activeX3Levels[level];
    }

    /**
     * @notice Get matrix information for user at level
     * @param userAddress User to query
     * @param level Level to query (1-12)
     * @return currentReferrer User's upline
     * @return referrals Array of referral addresses
     * @return blocked True if matrix blocked
     */
    function usersX3Matrix(address userAddress, uint8 level) public view returns(address, address[] memory, bool) {
        return (users[userAddress].x3Matrix[level].currentReferrer,
                users[userAddress].x3Matrix[level].referrals,
                users[userAddress].x3Matrix[level].blocked);
    }

    /**
     * @notice Check if user exists
     * @param user Address to check
     * @return bool True if user is registered
     */
    function isUserExists(address user) public view returns (bool) {
        return (users[user].id != 0);
    }

    /**
     * @notice Get user's balance information
     * @param _user Address to query
     * @return totalEarned Lifetime earnings
     * @return availableBalance Withdrawable balance
     */
    function getUserBalance(address _user) external view returns (uint256 totalEarned, uint256 availableBalance) {
        require(isUserExists(_user), "User does not exist");
        return (users[_user].totalEarned, users[_user].availableBalance);
    }

    /**
     * @notice Get total ETH held by contract
     * @return uint256 Contract balance in wei
     */
    function getContractBalance() external view returns (uint256) {
        return address(this).balance;
    }

    /**
     * @dev Convert bytes to address (for fallback function)
     * @param bys Bytes to convert
     * @return addr Extracted address
     */
    function bytesToAddress(bytes memory bys) private pure returns (address addr) {
        assembly {
            addr := mload(add(bys, 20))
        }
    }
}

